void clicked()
{
    super();

    WHSReservation      reservation = WHSReservation::construct();
    InventTransferLine  inventTransferLineLocal;

    for (inventTransferLineLocal = inventTransferLine_ds.getFirst(true) ? inventTransferLine_ds.getFirst(true) : inventTransferLine_ds.cursor();
    inventTransferLineLocal;
    inventTransferLineLocal = inventTransferLine_ds.getNext())
    {
        whsReleaseToWarehouseForm.addOrderLine(inventTransferLineLocal.InventTransId, whsTmpReleaseToWarehouse, WHSModule::Transfer);
    }

    whsTmpReleaseToWarehouse_ds.executeQuery();
}

void clicked()
{
    super();

    QueryRun           qr;
    InventTransferLine inventTransferLineLocal;

    inventTransferLine_ds.executeQuery();
    qr = inventTransferLine_ds.queryRun();

    do
    {
        inventTransferLineLocal = qr.get(tableNum(InventTransferLine));
        whsReleaseToWarehouseForm.addOrderLine(inventTransferLineLocal.InventTransId, whsTmpReleaseToWarehouse, WHSModule::Transfer);
    }
    while (qr.next());

    whsTmpReleaseToWarehouse_ds.executeQuery();
}

void clicked()
