    }

    whsTmpReleaseToWarehouse_ds.executeQuery();
}

public boolean modified()
{
    boolean ret = super();

    if (ret)
    {
        if (TransferIdFilter.text()
            && InventTransferTable::find(TransferIdFilter.text()).TransferId != TransferIdFilter.text())
        {
            TransferIdFilter.text('');
        }

        InventTransferLine_ds.executeQuery();
    }

    return ret;
}

public boolean modified()
{
    boolean ret = super();

    if (ret)
    {
        if (InventSiteIdFilter.text()
            && InventSite::find(InventSiteIdFilter.text()).SiteId != InventSiteIdFilter.text())
        {
            InventSiteIdFilter.text('');
        }

        InventTransferLine_ds.executeQuery();
    }

    return ret;
}

public boolean modified()
{
    boolean ret = super();

    if (ret)
    {
        if (InventLocationIdFilter.text())
        {
            InventLocationIdFilter.text(InventLocation::find(InventLocationIdFilter.text()).InventLocationId);
        }

        InventTransferLine_ds.executeQuery();
    }

    return ret;
}

